import React, { Component } from 'react';
import { Layout, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';
import "fullpage.js/vendors/scrolloverflow"; // Optional. When using scrollOverflow:true
import ReactFullpage from "@fullpage/react-fullpage";
import PCtechnical from './images/PC-Technical.jpg';

class Resume extends Component {
  render() {
    return (
      <ReactFullpage
        fitToSection = {true}
        sectionsColor = {["none", "none", "red"]}
        scrollOverflow = {true}
        render={({ state, fullpageApi }) => {
          return (
            <div id="fullpage-wrapper">
              <div className="section">
                <div className = "MainFormat" style={{backgroundImage: "PCtechnical"}}>
                <p>text</p>
                </div>
              </div>
              <div className="section fp-auto-height" >
                <div class="row">
                  <div class="columnLeft">
                  <p>text</p>
                  </div>
                  <div class="columnRight drop-shadow">
                  <p>text</p>
                  </div>
                </div>
                </div>
              <div className="section">
                <span className="slide">
                  <h3>Slide 2.1</h3>
                  <button onClick={() => fullpageApi.moveTo(3, 0)}>
                    Move top
                  </button>
                </span>
                <span className="slide">
                  <h3>Slide 2.2</h3>
                </span>
                <span className="slide">
                  <h3>Slide 2.3</h3>
                </span>
              </div>
            </div>
          );
        }}
      />
    );
  }
}




export default Resume;
